import Nav from "../components/Nav/Nav";
import About from "../components/About/About";

const AboutPage = () => {
	return (
		<main className="bg-white w-[70%] h-[85%] rounded-xl shadow-xl ">
			<Nav />
			<About />
		</main>
	);
};

export default AboutPage;
